import React from 'react';
import TodoItem from './TodoItem';

function TodoList({ todos,updateTodo,deleteTodo, handleSort  }) {
  return (
    <div className="todo-list-container">
      {todos.map((todo) => (
        <TodoItem key={todo.id} todo={todo} updateTodo= {updateTodo} deleteTodo={deleteTodo} handleSort ={handleSort }/>
      ))}
    </div>
  );
}

export default TodoList;
